import Vue from 'vue'
import App from './App.vue'
import Element from 'element-ui'
import store from '@/store'

Vue.config.productionTip = false


Vue.use(Element, {
  size: 'default',
})

// 保存整站vuex本地储存初始状态
window.SITE_CONFIG['storeState'] = cloneDeep(store.state)

new Vue({
  render: h => h(App),
}).$mount('#app')
